import React from 'react';
import { NavLink } from 'react-router-dom'

class LoggedInLinks extends React.Component {
  render() {
    return (
      <ul className="right">
        <button><NavLink to="/">Log Out</NavLink></button>
      </ul>
    );
  };
}

export default LoggedInLinks;
